import axios from 'axios';

export const initUrl = 'https://rickandmortyapi.com/api/character';

export const fetchAPI = async (url) => {
  const response = await axios.get(url);
  const { data } = response;
  return data;
};

export const fetchPrevious = async (url) => {
  const prev = await axios.get(url);
  const { prevData } = prev;
  return prevData;
};

export const fetchNext = async (url) => {
  const next = await axios.get(url);
  const { nextData } = next;
  console.log(next)
  return nextData;
}
